import React, { Component } from "react";

export class index extends Component {
  render() {
    return (
      <>
        <Sidebar />
        <div className="main-content">
          <Header />
          <h1 className="dash-title">User Profile</h1>
        </div>
      </>
    );
  }
}

export default index;
